import math

c, hr, hb, wr, wb = [int(x) for x in input().split()]

def max_joy(c, hr, hb, wr, wb):
    if c < wr or c < wb:
        return 0
    if wr == wb == 0:
        return 0
    if wr == 0:
        return c // wb * hb
    if wb == 0:
        return c // wr * hr
    if c % wb == 0:
        return c // wb * hb
    if c % wr == 0:
        return c // wr * hr
    return math.floor(c / wr) * hr + math.ceil(c / wb) * hb

print(max_joy(c, hr, hb, wr, wb))

